import Movies from "../components/Movies";
const MainMovies = () => {
  return (
    <>
      <Movies j={1} k={30} />
      <Movies j={31} k={60} />
      <Movies j={220} k={400} />
      <Movies j={550} k={600} />
      <Movies j={710} k={750} />
      <Movies j={150} k={200} />
      <Movies j={80} k={120} />
      <Movies j={121} k={149} />
    </>
  );
};

export default MainMovies;
